import styled from 'styled-components';


export const NavigationBar = styled.nav`
  font-family: 'Lato', sans-serif;
  display: flex;
  justify-content: flex-end;
  width: 100%;
  height: 20%;

    .home {
      font-size: 2em;
      color: white;
      
      width: 207px; 
      height: 25px; 
    }

    .uList {
      display: flex;
      justify-content: flex-end;
      height: 15%;
      width: 50%;
      padding-right: 128px;

        .how-works {
          background-image: linear-gradient(to right, transparent 70%, rgba(0, 0, 0, .150), transparent);
          padding: 0 22px 0;; 
        }
    
        li {
          filter: brightness(100000000%);
          font-size: 15px;
          list-style: none;
          color: white;
          padding: 23.5px;
        }

        img {
          width: 24px;
          height: 26px;
          padding-left: 47px;
        }
  }

  
  }
  
`;
